import React from 'react';
import marsmenu from './MenuStyle/Mars_menu.module.scss';
import marsani from './AnimationStyle/Earth_animation.module.scss';

const Earth = ({checked}) => {
    return (
        <>
        <div id= {checked ? earthani.earth_animode : earthmenu.earth_menumode}></div>
        </>
    );
};

export default Earth;
